Angle1 = Angle1.Increment()
' Incorrect use of Increment
Dim Angle1 = New Angle(89)
Angle1.Increment()
' Notice: Angle1 will still be 89°!


// Correct use of Increment
Angle Angle1 = new Angle(89);
Angle1 = Angle1.Increment();
// Incorrect use of Increment
Angle Angle1 = new Angle(89);
Angle1.Increment();
// Notice: Angle1 will still be 89°!

